#include <iostream>

using namespace std;

char findTheDifference(string s, string t)
{
    int totale = 0;
    for (size_t i = 0; i < t.length(); i++)
    {
        totale = totale + t[i];
    }
    int totale1 = 0;
    for (size_t i = 0; i < s.length(); i++)
    {
        totale1 = totale1 + s[i];
    }
    int result = totale - totale1;
    return (char)result;
}

int main()
{
    std::string s = "ah";
    int i = 'a';
    // cout << i << endl;
    // cout << findTheDifference("abcd","abcde");
    cout << findTheDifference("","");
}